  false,\n\t\"url\": null,\n\t\"notes\": \"BPI Structures are derived from two scales
  of a focal mean analysis on bathymetry and slope. The grid is based on gridded (10
  m cell size) multibeam bathymetry, collected aboard NOAA Ship Hi'ialakai and R/V
  AHI, and it was created using the Benthic Terrain Modeler (http://www.csc.noaa.gov/products/btm/).
  Cell values represent one of 14 classes in an index of seafloor terrains. This data
  set is for the shelf and slope environments of Farallon de Pajaros Island. As part
  of the northern islands of the Mariana Islands archipelago, the island's offshore
  shelf is above -60m. A deep shelf (below -60m) northeast of the island may be reminiscent
  of a second and recently active volcanic cone.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
